    Io(io::Error),
    UnknownOpCode,
    ReservedOpCode,
    FragmentedControl,
    InvalidControlFrameLen,
    InvalidReservedBit(u8),
    PayloadTooLarge {
            actual: u64,
            maximum: u64,
        },
}

fn set_value<impl Into<Cow<'a, str>>>(&mut Self,
Option<impl Into<Cow<'a, str>>>) -> &mut Self where
impl Into<Cow<'a, str>>: Into<Cow>

enum ServerResponse {
    Accepted {
            protocol: Option<String>,
        },
    Redirect {
            status_code: u16,
            location: String,
        },
    Rejected {
            status_code: u16,
        },
}

enum Response<'a> {
    Accept {
            key: &'a [u8],
            protocol: Option<&'a str>,
        },
    Reject {
            status_code: u16,
        },
}

enum Error {
    Io(io::Error),
    Codec(base::Error),
    Extension(crate::BoxedError),
    UnexpectedOpCode(OpCode),
    Utf8(str::Utf8Error),
    MessageTooLarge {
            current: usize,
            maximum: usize,
        },
    Closed,
}

enum Parsing<T, N = ()> {
    Done {
            value: T,
            offset: usize,
        },
    NeedMore(N),
}
